  import Vue from 'vue'
  import VeeValidate from 'vee-validate'

  Vue.use(VeeValidate)

  export default {
    $_veeValidate: {
      validator: 'new'
    },

    data: () => ({
        email: '',
        password: '',
        dictionary: {
            attributes: {
                email: 'E-mail Address',
                password: 'Password'
                // custom attributes
            },
        }
    }),
    mounted () {
        this.$validator.localize('en', this.dictionary)
    },
    methods: {
        submit () {
            this.$validator.validateAll()
        },
        clear () {
            this.email = '',
            this.password = '',
            this.$validator.reset()
        }
    }
}
